import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import "./App.css";

const Emoji = (props) => {
  return (
    <Aux>
    <div className = "div4">
            <span>{props.emo}</span>
            <p>Hello! The world is beuatiful</p>
    </div>
            
    </Aux>
  );
};

export default Emoji;
